DROP TABLE IF EXISTS `wms_order`;
CREATE TABLE `wms_order` (
  `id` int(8) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增长ID',
  `platform` int(11) NOT NULL COMMENT '同步平台,1:PayPal(ebay),2:AliPay(aliexpress)',
  `internal_transaction_id` varchar(12) DEFAULT NULL COMMENT '内部交易ID',
  `api_account` varchar(100) DEFAULT NULL COMMENT '同步ID的账号',
  `tracking_number` varchar(100) DEFAULT NULL COMMENT '运单号',
  `agent` tinyint(4) DEFAULT NULL COMMENT '物流代理,1:出口易,2：,3:三态速递,4:递四方物流',
  `express` varchar(100) DEFAULT NULL COMMENT '快递方式',
  `postage` decimal(10,2) DEFAULT NULL COMMENT '快递运费',
  `status` tinyint(4) DEFAULT NULL COMMENT '订单状态，1:已同步，2:未处理，3:发货中,4:已发货,5:运输中,6:已签收,7:已完成',
  `create_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2564 DEFAULT CHARSET=utf8;

