  `payer_state_or_province` varchar(40) DEFAULT NULL COMMENT '省/州',
  `payer_postal_code` varchar(20) DEFAULT NULL COMMENT '邮编',
  `payer_country` varchar(2) DEFAULT NULL COMMENT '国家代码',
  `payer_country_name` varchar(64) DEFAULT NULL COMMENT '国家名称',
  `payer_phone` varchar(20) DEFAULT NULL COMMENT '电话号码',
  `transaction_id` varchar(19) DEFAULT NULL COMMENT '支付的唯一ID',
  `ebay_transaction_id` varchar(19) DEFAULT NULL COMMENT 'ebay支付的唯一ID',
  `payment_type` varchar(7) DEFAULT NULL COMMENT '支付是即时还是延时，值是none/echeck/instant',
  `payment_date` int(11) DEFAULT NULL COMMENT '支付时间戳，UTC/GMT格式，例如：2013-08-24T05:38:48Z',
  `currency_code` varchar(10) DEFAULT NULL COMMENT '货币代码',
  `gross_amount` decimal(18,2) DEFAULT NULL COMMENT '总额，包括税和运费',
  `fee_amount` decimal(18,2) DEFAULT NULL COMMENT 'PayPal交易收费金额',
  `settle_amount` decimal(18,2) DEFAULT NULL COMMENT 'Paypal货币转换后的金额',
  `tax_amount` varchar(20) DEFAULT NULL COMMENT '交易税费',
  `exchange_rate` varchar(17) DEFAULT NULL COMMENT '汇率',
  `payment_status` varchar(100) DEFAULT NULL COMMENT '支付状态:None/Canceled-Reversal/Completed/Denied/Expired/Failed/In-Progress/Partially-Refunded/Pending/Refunded/Reversed/Processed/Voided',
  `pending_reason` varchar(100) DEFAULT NULL COMMENT '未定状态',
  `invoice_id` varchar(256) DEFAULT NULL COMMENT '发票ID',
  `memo` varchar(255) DEFAULT NULL COMMENT '客户备忘录',
  `sales_tax` varchar(256) DEFAULT NULL COMMENT '销售税费',
  `payer_status` varchar(10) DEFAULT NULL COMMENT '买家状态，verified/unverified',
  `subject` varchar(500) DEFAULT NULL COMMENT '主题',
  `buyer_id` varchar(256) DEFAULT NULL COMMENT '买家ID',
  `parent_transaction_id` varchar(256) DEFAULT NULL COMMENT '父交易ID',
  `create_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '注册时间',
  `update_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`)
